// App.js
import React from 'react';
import {DarkModeProvider} from "./components/DarkModeContext";
import DarkModeToggle from "./components/DarkModeToggle";

function App() {
    return (
        <DarkModeProvider>
            <div className={`App`}>
                <header className="App-header">
                    <DarkModeToggle/>
                    <p>APP</p>
                </header>
            </div>
        </DarkModeProvider>
    );
}

export default App;
